import { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/AdminDashboard.css'; 

function AdminDashboard() {
  const navigate = useNavigate();

  // Optional: Check if admin is logged in (replace with actual auth logic)
  useEffect(() => {
    const isAdmin = true; // Replace this with actual check
    if (!isAdmin) {
      navigate('/login');
    }
  }, [navigate]);

  return (
    <div className="admin-dashboard">
      <aside className="admin-sidebar">
        <h2>Admin Panel</h2>
        <nav>
          <ul>
            <li><a href="#users">Manage Users</a></li>
            <li><a href="#properties">Manage Properties</a></li>
            <li><a href="#settings">Settings</a></li>
            <li><button onClick={() => navigate('/login')}>Logout</button></li>
          </ul>
        </nav>
      </aside>

      <main className="admin-main">
        <section id="welcome">
          <h1>Welcome, Admin</h1>
          <p>This is your dashboard overview. Use the sidebar to manage the system.</p>
        </section>

        <section id="users">
          <h2>Manage Users</h2>
          <p>Placeholder for user management (list, edit, delete, etc.)</p>
        </section>

        <section id="properties">
          <h2>Manage Properties</h2>
          <p>Placeholder for property management features</p>
        </section>

        <section id="settings">
          <h2>Settings</h2>
          <p>Placeholder for dashboard or system settings</p>
        </section>
      </main>
    </div>
  );
}

export default AdminDashboard;
